webpackJsonp([0xaa7f085891dc],{8726:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Blogging for Community Action Groups",date:"06 Oct 2003",slug:"/2003-10-06-blogging-for-community-action-groups/",tags:"Y2003"},html:'<p>My <a title="PapaScott: Windmills over Lüllau" href="http://www.papascott.de/2003/09/27/2600.php">windmill</a> post has gotten <a title="E-Business Weblog/Newsfeed" href="http://www.roell.net/weblog/newsfeed/2003/10/04.shtml#003552">some</a> <a title="Wind Energy Primer by Heiko Hebig | hebig.com" href="http://www.hebig.com/archives/001565.shtml">attention</a> as it contains some good comments pro and con on wind energy in general. I should have expected that, since readers would certainly care more about the general issue than about my backyard (or even the property value of my backyard). </p>\n<p>I\'m actually finding the organizational effort more interesting than the issue itself. This evening about 30 of us will be meeting and will probably formally form a community action group. I\'m wondering, wouldn\'t a weblog be the perfect tool for such a fledgling group? I\'ll try to explain the concept to my neighbors the best I can. Do any of you know of basic user documention (as opposed to setup/admin documentation) for Movable Type in German?</p>'},next:{fields:{title:"AL Playoffs: Yankees 8 Twins 1",date:"06 Oct 2003",slug:"/2003-10-06-al-playoffs-yankees-8-twins-1/"}},previous:{fields:{title:"Extreme Monday Syndrome",date:"06 Oct 2003",slug:"/2003-10-06-extreme-monday-syndrome/"}}},{node:{fields:{title:"AL Playoffs: Yankees 8 Twins 1",date:"06 Oct 2003",slug:"/2003-10-06-al-playoffs-yankees-8-twins-1/",tags:"Y2003"},html:'<p><a title="Yankees win series 3-1" href="http://sports.yahoo.com/mlb/recap?gid=231005109">AL Playoffs: Yankees 8 Twins 1</a></p>'},next:{fields:{title:"Animal Park Overload",date:"05 Oct 2003",slug:"/2003-10-05-animal-park-overload/"}},previous:{fields:{title:"Blogging for Community Action Groups",date:"06 Oct 2003",slug:"/2003-10-06-blogging-for-community-action-groups/"}}},{node:{fields:{title:"Animal Park Overload",date:"05 Oct 2003",slug:"/2003-10-05-animal-park-overload/",tags:"Y2003"},html:'<p>With his Grandma here for two and a half weeks, Christopher has now visited <a title="Willkommen beim Wildpark Lüneburger Heide" href="http://www.wild-park.de/">3</a> <a title="Willkommen im Serengetipark!" href="http://www.serengeti-park.de/">animal</a> <a title="Tierpark Hagenbeck" href="http://www.hagenbeck.de/">parks</a> in the past 10 days &lt;insert obligatory photo of Christopher feeding elephants here&gt;. I think he is starting to suffer from animal park overload. He now has a dozen toy animals set up throughout the living room and kitchen for his jungle safari jeep tour, complete with special effects and very loud narration. And it is way past his bedtime.</p>'},next:{fields:{title:"It's your fault",date:"04 Oct 2003",slug:"/2003-10-04-its-your-fault/"}},previous:{fields:{title:"AL Playoffs: Yankees 8 Twins 1",date:"06 Oct 2003",slug:"/2003-10-06-al-playoffs-yankees-8-twins-1/"}}}],pathPrefix:"",first:!1,last:!1,index:617,pageCount:1101}}}});
